import React from 'react';
import './App.css';

class Card extends React.Component {
    render() {
        return (
            <div className="Card">

            </div>
        );
    }
}

class Board extends React.Component {
    render() {
        return (
            <Card />
        );
    }
}


function App() {
  return (
    <div className="App">
      <Board/>
    </div>
  );
}

export default App;
